CREATE OR REPLACE FUNCTION insert_custom_event_price(
    event_name TEXT,
    role_name TEXT,
    price NUMERIC
)
    RETURNS VOID AS
$$
BEGIN
VALUES ((SELECT id FROM events WHERE name = event_name),
        (SELECT id FROM roles WHERE name = role_name),
        price);
END;
$$ LANGUAGE plpgsql;

